import React from 'react';
import { Upload, Image } from 'cloudinary-react';


const ImageUpload = () => {
  const handleUpload = (event) => {
    console.log('Upload successful:', event);
  };

  return (
    <div>
      <h2>Image Upload</h2>
      <Upload
        cloudName="dqazq6qwd"
        uploadPreset="image/jpg"
        onSuccess={handleUpload}
        folder="Home/unc-com-images"
      >
        Click to upload
      </Upload>
      <Image
        cloudName="dqazq6qwd"
        publicId="default-image"
        width="300"
        crop="scale"
      />
    </div>
  );
};

export default ImageUpload;
